INSERT INTO `search_dataset` VALUES (1,'node',' studies this page displays the list of the consortium s studies each study is described in a same standard way that can be easily customized to reflect consortium specificities however mica suggests by default a list of important study characteristics that should be considered if there is an aim for the consortium to participate in data harmonization projects with other consortia or studies  ',0),(2,'node',' datasets to harmonize data between studies participating in the consortium studyspecific datasets and harmonized datasets ie variables targeted for harmonization are used and made available to investigators variables collected by each study and those defined in the harmonization dataset are described using a standardized data dictionary which covers variable definitions and characteristics eg type unit categories and area of information covered once study datasets and a harmonization dataset are defined and loaded in the system variablespecific mapping algorithms are developed in order to derive the study datasets into the common format defined in the harmonization dataset in order to increase transparency of the harmonization process these resources are made available to the research community  ',0),(3,'node',' harmonization datasets a harmonization dataset documents and annotates a set of core variables which provides a concise but effective list of information to be harmonized in a specific scientific context variables found in a harmonization dataset therefore represent the reference format into which studyspecific data needs to be processed to arrive at harmonized data when a study can generate a variable defined in a harmonization dataset a processing algorithm is developed to map studyspecific data to the variable format defined in the harmonization dataset  ',0),(4,'node',' study datasets a study dataset holds and describes variables collected by studies participating in a consortium study datasets make use of standardized data dictionary which gives information on variable definitions and characteristics eg type unit categories and area of information covered using the variable search tool researchers are able to query data collected across studies participating in the consortium  ',0),(5,'node',' networks this page displays the list of networks by clicking on the links below users can learn about an specific network and its associated studies  ',0),(6,'node',' data access requests for further information on the datasets and requests for access are received by the our access office prior to submitting a data access application form we strongly recommend that you consult the our policy documents that will provide you with detailed information about the process and our s access publication and intellectual property policies  ',0);
